export class Zapatilla {
  
    public nombre:string;
    precio:number;
    marca:string;
    color:string;
    stock:boolean;

    constructor(nombre, precio, marca, color, stock){
        this.nombre = nombre;
        this.precio = precio;
        this.marca = marca;
        this.color = color;
        this.stock = stock;
    }

}
